import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
import HeroSection from "./HeroSection";
import AppSection from './Appsection';

const App = () => {
	return (
		<div>
			<Navbar />;
			<HeroSection />;
			<Footer />;
		</div>
	);
};

export default App;
